import React from 'react';

import { createStackNavigator } from '@react-navigation/stack';
import { NavigationContainer } from '@react-navigation/native';

import StackInicio from './src/pages/Inicio';

import {ContextInfo, ContextInfoProvider } from './src/pages/ContextInfo/contextinfo';

const Stack = createStackNavigator();


function MyStack() {
  return (
    <ContextInfoProvider>
      <Stack.Navigator>
        <Stack.Group>
          <Stack.Screen name='StackInicio' component={StackInicio}  options={{ headerShown: false }}/>
         
        </Stack.Group>
      </Stack.Navigator>

    </ContextInfoProvider>

  )
}

export default function App() {
  return (

    <NavigationContainer>
      <MyStack />
    </NavigationContainer>
  )
}
